from sympy import *

N = 6
# Define symbols
m1, m2, m3, m4, m5, m6, x1, x2, x3, x4, x5, x6 = symbols('m1 m2 m3 m4 m5 m6 x1 x2 x3 x4 x5 x6')
t = symbols('t')
m = [m1, m2, m3, m4, m5, m6]
x = [x1, x2, x3, x4, x5, x6]

def sign(k1, k2):
	return 0 if k1 == k2 else (1 if k1 > k2 else -1)
def u(k):
	xk = x[k-1]
	total = 0
	for i in range(1, N+1):
		total += m[i-1]*(xk - x[i-1])*sign(k, i)
	return total.simplify()
def ux(k):
	total = 0
	for i in range(1, N+1):
		total += m[i-1]*sign(k, i)
	return total

